	["aa_vertigo"] = { name = "Hypnotic", desc = "Den er blevet malet med en perlefarvet underlak og derefter spraymalet sort gennem en skabelon i et grafik-mønster.\n\nDu er ikke søvnig, du er ved at besvime af blodmangel" },
